import React from 'react'
import {render} from 'react-dom';

import {
    BrowserRouter as Router,
    Route,
    Redirect,
    Switch
} from 'react-router-dom';

import App from './app/App'
import Home from './app/layout/Home'
import About from './app/layout/About'
import Services from './app/layout/Services'
import SingleService from './app/layout/SingleService'
import Community from './app/layout/Community'
import Contact from './app/layout/Contact'
import Team from './app/layout/Team'
import TeamSingle from './app/layout/TeamSingle'
import Insights from './app/layout/Insights'

class AppInitializer {

    run() {
        render(
            <Router>
                <Switch>
                  <Route exact path='/' component={Home}/>
                  <Route exact path='/' component={App}/>
                  <Route path='/about' component={About}/>
                  <Route exact path='/services' component={Services}/>
                  <Route path='/services/:id' component={SingleService}/>
                  <Route path='/community' component={Community}/>
                  <Route path='/contact' component={Contact}/>
                  <Route exact path='/team' component={Team}/>
                  <Route path='/team/:id' component={TeamSingle}/>
                  <Route path='/blog' component={Insights}/>
                </Switch>
            </Router>

            , document.getElementById('root')
        );
    }
}

new AppInitializer().run();

